≠nea como se describe a continuaci√≥n: primero, el s√≠mbolo en el centro del texto es escrito (si los caracteres van de las posiciones <b>1 a n</b>, entonces el primer car√°cter que se escribe es el car√°cter en la posici√≥n <b>(1 + n) / 2</b>). Siguiendo la misma estrategia, el algoritmo codifica la mitad izquierda de la cadena, a continuaci√≥n la derecha y √∫ltima mitad. De este modo, el programa en Pascal:<br></div><br><pre>program p1000(Input,Output);<br>var<br>&nbsp;&nbsp;&nbsp; a,b:Integer;<br>begin<br>&nbsp;&nbsp;&nbsp;&nbsp;Readln(a,b);<br>&nbsp;&nbsp;&nbsp;&nbsp;Writeln(a+b);<br>end.<br></pre>ser√°:<br><pre>(npqsshb1 q000PqJouv,vuvq)u;<br>bws<br>:&nbsp;&nbsp;&nbsp;&nbsp;,bcfoJufhs;<br>hcfjo<br>e&nbsp;&nbsp;&nbsp;&nbsp;fSbbom(c,);<br>f&nbsp;&nbsp;&nbsp;&nbsp;sXjubom(c+);<br>ofe.<br></pre>A Enrique le tom√≥ un rato programar el codificador, y ahora quiere pedirle a usted que le ayude a revertir las encriptaciones.<br>', '', 'Cifrando programas', '<div align="justify">La entrada consiste en un programa, codificado seg√∫n la estrategia sugerida por Enrique.<br>Ninguna l√≠nea en este programa contiene m√°s de 20000 caracteres.</div>', '', '', '<div align="justify">La salida consiste en el programa de Enrique decodificado. Este resultado ser√° exactamente el mismo que el programa descrito originalmente.</div>', true, '', 154);


