#include<cstdio>
#include<cmath>
#include<climits>
#include<iomanip>

using namespace std;

const int MAXV = 101;
double oo = 0;

int N;
double X[MAXV], Y[MAXV];
double MA[MAXV][MAXV];

bool mk[MAXV];
double C[MAXV];
double CostPrim(){
	for (int i = 1 ; i <= N ; i++)
		C[i] = oo;
	C[1] = 0;
	//mk[1] = true;
	double COSTO = 0.0;
	for (int i = 1 ; i <= N ; i++){
		double min = oo;
		int v;
		for (int j = 1 ; j <= N ; j++)
			if (!mk[j] && C[j] < min){
				min = C[j];
				v = j;
            }
		COSTO += min;
		mk[v] = true;
		for (int j = 1 ; j <= N ; j++)
			if (!mk[j]){
				if (C[j] > MA[v][j])
					C[j] = MA[v][j];
			}
	}
	return COSTO;
}



int main(){
	//freopen("d.i", "r", stdin);
	cin >> N;
	for (int i = 1 ; i <= N ; i++)
		cin >> X[i] >> Y[i];
	for (int i = 1 ; i < N ; i++)
		for (int j = i + 1 ; j <= N ; j++){
			double difX = X[j] - X[i];
			double difY = Y[j] - Y[i];
			MA[i][j] = MA[j][i] = sqrt(difX * difX + difY * difY);
			if (MA[i][j] + 1 > oo)
                oo = MA[i][j] + 1;
		}

    //cout << setprecision(3);
	//cout << CostPrim() << ''\n'';
	printf("%.2lf\n", CostPrim());
	//fclose(stdin);
	return 0;
}

