INSERT INTO faq (answer, question, id) VALUES ('You can use all the standard libraries included with the programming language that you are using. For example, this includes the STL (Standard Template Library) of C++ and the java.lang.BigInteger class of Java.', 'WHAT PROGRAMMING LIBRARIES CAN I USE?', 1);
INSERT INTO faq (answer, question, id) VALUES ('When the COJ has judged your submission, you will get a judgment that tells you what is the status of your solution. You can view the verdict on the <a href="/24h/status.xhtml">judgments</a> page. The following judgments are possible:
INSERT INTO faq (answer, question, id) VALUES ('Yes. This works as follows:
INSERT INTO faq (answer, question, id) VALUES ('<p>Some details about the available programming languages are displayed in the table at the end of this page .</p>
INSERT INTO faq (answer, question, id) VALUES ('<p>The source code sent by the user:</p>
INSERT INTO faq (answer, question, id) VALUES ('<div align="justify">Internal Error is an error in judgments, or engine error, that is supposed which should not happen. Some errors are not internal, because they originate from the source code and they are expected, such as compilation errors or run-time errors; those are commonly reported to users as normal verdicts in the system. But there are errors related with inconsistent or missing datasets, or because the server does not have enough space, or even due errors in system programming; then an unexpected error is originated. That is an Internal Error, and must be closely reviewed by COJ Development Team (CDEVT).</div>', 'WHICH IS THE MEANING OF INTERNAL ERROR?', 15);
INSERT INTO faq (answer, question, id) VALUES ('<p align="justify">Yes. Almost all problems are associated with one or more tags. A tag is an element which includes both complexity and knowledge area of some problem. If you can¬¥t see the tags in the problems, you should probably go and edit the personal profile and mark the option "Show tags".<br><br>The complexity is an estimated integer number which go from 1 to 5: Very Easy (1), Easy (2), Medium (3), Hard (4), Very Hard (5). This is a relative value which is supposed to be established by their authors; but sometimes they are not available at all. Obviously, with the time the users could propose changes to adjust real complexity of some problem.<br><br>Although in general is really difficult to make a standard grouping/classification of the knowledge areas related with computing programming, the following proposal used by Caribbean Online Judge to group their problems in categories is pretty close to desired goal:</p><ul><li>Ad-hoc (AH)</li><li>Arithmetic-Algebra (AA)</li><li>Brute Force (BF)</li><li>Combination (CO)</li><li>Data Structures (DS)</li><li>Dynamic Programming (DP)</li><li>Game Theory (GA)</li><li>General Geometry (GE)</li><li>Graph Theory (GT)</li><li>Greedy (GR)</li><li>Set-Number Theory (NT)</li><li>Sorting-Searching (SS)</li><li>Strings (ST)</li></ul><p align="justify">Then, problem categorization or tags, could be something like: "GE4" or "NT3, AA3" or "DP3, GT2" (remember that problems can have multiple categorizations but, we certainly avoid to use multiple complexities or unnecessary classifications).<br></p>', 'CAN I SEE THE COMPLEXITY OR KNOWLEDGE AREA OF THE PROBLEMS?', 18);
