INSERT INTO problem (pid, title, description, input, output, input_example, output_example, author, comments, point, "time", memory, fontsize, contest, date, abb, uid, enable, case_time_limit, multidata, disable_24h, special_judge, comments_es, comments_pt, description_pt, description_es, title_pt, title_es, input_es, input_pt, output_pt, output_es, event_created_processed, forum_link, id_source) VALUES (1011, 'Army Strength', '<div style="text-align: justify;">The next MechaGodzilla invasion is on its way to Earth. And once again, Earth will be the battleground for an epic war.
INSERT INTO problem (pid, title, description, input, output, input_example, output_example, author, comments, point, "time", memory, fontsize, contest, date, abb, uid, enable, case_time_limit, multidata, disable_24h, special_judge, comments_es, comments_pt, description_pt, description_es, title_pt, title_es, input_es, input_pt, output_pt, output_es, event_created_processed, forum_link, id_source) VALUES (1005, 'Rent your Airplane and make Money', '<div style="text-align: justify;">"ABEAS Corp." is a very small company that owns a single airplane. The customers of ABEAS Corp are large airline companies which rent the airplane to accommodate occasional overcapacity.
INSERT INTO problem (pid, title, description, input, output, input_example, output_example, author, comments, point, "time", memory, fontsize, contest, date, abb, uid, enable, case_time_limit, multidata, disable_24h, special_judge, comments_es, comments_pt, description_pt, description_es, title_pt, title_es, input_es, input_pt, output_pt, output_es, event_created_processed, forum_link, id_source) VALUES (1003, 'General Election', '<div style="text-align: justify;">General Election is over, now it is time to count the votes! There are <span style="font-weight: bold;">n (2 &lt;= n &lt;= 5) </span>candidates and <span style="font-weight: bold;">m (1 &lt;= m &lt;= 100)</span> vote regions. Given the number of votes for each candidate from each region, determine which candidate is the winner (one with the most votes).</div>', '<div style="text-align: justify;">The first line of input contains an integer <span style="font-weight: bold;">T (1 &lt;= T &lt;= 100)</span>, the number of test cases follow.
INSERT INTO problem (pid, title, description, input, output, input_example, output_example, author, comments, point, "time", memory, fontsize, contest, date, abb, uid, enable, case_time_limit, multidata, disable_24h, special_judge, comments_es, comments_pt, description_pt, description_es, title_pt, title_es, input_es, input_pt, output_pt, output_es, event_created_processed, forum_link, id_source) VALUES (1016, 'Freckles', '<div style="text-align: justify;">In an episode of the Dick Van Dyke show, little Richie connects the freckles on his Dad''s back to form a picture of the Liberty Bell. Alas, one of the freckles turns out to be a scar, so his Ripley''s engagement falls through.
INSERT INTO problem (pid, title, description, input, output, input_example, output_example, author, comments, point, "time", memory, fontsize, contest, date, abb, uid, enable, case_time_limit, multidata, disable_24h, special_judge, comments_es, comments_pt, description_pt, description_es, title_pt, title_es, input_es, input_pt, output_pt, output_es, event_created_processed, forum_link, id_source) VALUES (1018, 'Ferry Loading III', '<div style="text-align: justify;">Before bridges were common, ferries were used to transport cars across rivers. River ferries, unlike their larger cousins, run on a guide line and are powered by the river''s current. Cars drive onto the ferry from one end, the ferry crosses the river, and the cars exit from the other end of the ferry.
INSERT INTO problem (pid, title, description, input, output, input_example, output_example, author, comments, point, "time", memory, fontsize, contest, date, abb, uid, enable, case_time_limit, multidata, disable_24h, special_judge, comments_es, comments_pt, description_pt, description_es, title_pt, title_es, input_es, input_pt, output_pt, output_es, event_created_processed, forum_link, id_source) VALUES (1017, 'Three powers', '<div style="text-align: justify;">Consider the set of all non-negative integer powers of 3.
INSERT INTO problem (pid, title, description, input, output, input_example, output_example, author, comments, point, "time", memory, fontsize, contest, date, abb, uid, enable, case_time_limit, multidata, disable_24h, special_judge, comments_es, comments_pt, description_pt, description_es, title_pt, title_es, input_es, input_pt, output_pt, output_es, event_created_processed, forum_link, id_source) VALUES (1019, 'Flipping colors', '<div style="text-align: justify;">A rectangle with sides parallel to the x-y axes and its left-lower corner at (0,0) is being painted. The rectangle may be thought of as a flat-screen display with almost infinite resolution; initially the entire rectangle is black.<br><div align="center"><img src="../downloads/images/fcolor.jpg"><br></div>Two numbers are given <span style="font-weight: bold;">0 &lt; h,v &lt; 1</span> and then:<br>* A vertical line is drawn dividing the horizontal sides of the rectangle in proportion <span style="font-weight: bold;">h:1-h</span> from the left.<br>* A horizontal line is drawn dividing the vertical sides of the rectangles in proportion <span style="font-weight: bold;">v:1-v</span> from the bottom up.<br>* These two lines divide the rectangle into four smaller rectangles.<br>* The upper left and the lower right sub-rectangles remain intact.<br>* The color of the other two rectangles is flipped (from black to white or from white to black) and now each of them is subject to the operation just performed on the bigger rectangle.<br>* This process continues (in principle) forever.<br><br>Given a point in the original rectangle but not on the boundary of any rectangle that turns up in the process of painting, determine the color of the point.</div>', '<div style="text-align: justify;">Input contains multiple cases (no more than 10). The first line of each case contains 4 numbers, the length of the rectangle <span style="font-weight: bold;">H</span>, the height of the rectangle <span style="font-weight: bold;">V</span> and then the numbers <span style="font-weight: bold;">h</span> and <span style="font-weight: bold;">v</span>. The next line contains one integer number <span style="font-weight: bold;">n</span>, the number of points to consider. The following <span style="font-weight: bold;">n</span> lines contain two numbers each, the x and the y coordinate of a point.</div>', '<div style="text-align: justify;">Organize your output as shown in the sample. For each point from input print the color of the point.</div>', '81 32 0.333333333333 0.5<br>6<br>16 30<br>16 25<br>16 12.0001<br>16 11.9999<br>16 7.987654321<br>16 7.0123456789<br>10 10 0.123456789 0.987654321<br>2<br>0.432 0.9876<br>9.432 0.9876<br>0 0 0 0<br>', 'Case 1:<br>black<br>black<br>white<br>black<br>white<br>white<br>Case 2:<br>white<br>black<br>', 'Waterloo Local Contest [Piotr Rudnicki]', '', 5, 2000, 65536000, 30720, 1, '2011-10-13 06:28:52.0', '1019', 34227, true, 2000, false, false, false, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, true, 'https://coj-forum.uci.cu/viewtopic.php?f=22&t=147', 494);
INSERT INTO problem (pid, title, description, input, output, input_example, output_example, author, comments, point, "time", memory, fontsize, contest, date, abb, uid, enable, case_time_limit, multidata, disable_24h, special_judge, comments_es, comments_pt, description_pt, description_es, title_pt, title_es, input_es, input_pt, output_pt, output_es, event_created_processed, forum_link, id_source) VALUES (1014, 'Traditional BINGO', '<div style="text-align: justify;">Traditional BINGO is played in person in a large hall. Players meet at the hall, pay a fee to get in, then the games begin. A night of BINGO consists of many BINGO games played continuously, one after another.
INSERT INTO problem (pid, title, description, input, output, input_example, output_example, author, comments, point, "time", memory, fontsize, contest, date, abb, uid, enable, case_time_limit, multidata, disable_24h, special_judge, comments_es, comments_pt, description_pt, description_es, title_pt, title_es, input_es, input_pt, output_pt, output_es, event_created_processed, forum_link, id_source) VALUES (1010, 'ACM contest and Blackout', '<div style="text-align: justify;">In order to prepare the "The First National ACM School Contest" (in 2001) the major of the city decided to provide all the schools with a reliable source of power. The major is really afraid of blackouts. So, in order to do that, power station "Future" and one school (does not matter which one) must be connected; in addition, some schools may be connected as well.
INSERT INTO problem (pid, title, description, input, output, input_example, output_example, author, comments, point, "time", memory, fontsize, contest, date, abb, uid, enable, case_time_limit, multidata, disable_24h, special_judge, comments_es, comments_pt, description_pt, description_es, title_pt, title_es, input_es, input_pt, output_pt, output_es, event_created_processed, forum_link, id_source) VALUES (1015, 'A Walk Through the Forest', '<div style="text-align: justify;">Jimmy experiences a lot of stress at work these days, especially since his accident made working difficult. To relax after a hard day, he likes to walk home. To make things even nicer, his office is on one side of a forest, and his house is on the other. A nice walk through the forest, seeing the birds and chipmunks is quite enjoyable.
INSERT INTO problem (pid, title, description, input, output, input_example, output_example, author, comments, point, "time", memory, fontsize, contest, date, abb, uid, enable, case_time_limit, multidata, disable_24h, special_judge, comments_es, comments_pt, description_pt, description_es, title_pt, title_es, input_es, input_pt, output_pt, output_es, event_created_processed, forum_link, id_source) VALUES (1020, 'Rock-Paper-Scissors Tournament', '<div style="text-align: justify;" align="center"><div align="center"><img src="../downloads/images/ejercicio1009.jpg"><br></div>Rock-Paper-Scissors is game for two players, A and B, who each choose, independently of the other, one of rock, paper, or scissors. A player chosing paper wins over a player chosing rock; a player chosing scissors wins over a player chosing paper; a player chosing rock wins over a player chosing scissors. A player chosing the same thing as the other player neither wins nor loses.
INSERT INTO problem (pid, title, description, input, output, input_example, output_example, author, comments, point, "time", memory, fontsize, contest, date, abb, uid, enable, case_time_limit, multidata, disable_24h, special_judge, comments_es, comments_pt, description_pt, description_es, title_pt, title_es, input_es, input_pt, output_pt, output_es, event_created_processed, forum_link, id_source) VALUES (1007, 'Square Town Tales: Power Down', '<div style="text-align: justify;">In Square Town, the nuclear plant has gone off-line for no reason. The whole city is in darkness, crime and confusion increase at every moment. The mayor, understandably concerned, has commissioned the construction of a new electrical power plant, funded from the meagre city treasury. The commission went to a specialised company, one that builds custom power plants according to existing costumer demand.
INSERT INTO problem (pid, title, description, input, output, input_example, output_example, author, comments, point, "time", memory, fontsize, contest, date, abb, uid, enable, case_time_limit, multidata, disable_24h, special_judge, comments_es, comments_pt, description_pt, description_es, title_pt, title_es, input_es, input_pt, output_pt, output_es, event_created_processed, forum_link, id_source) VALUES (1008, 'Overlapping Air Traffic Control Zones', '<div style="text-align: justify;">Optimisation of air traffic flow is one of the essential ways for airlines to maintain economic viability. All too often, however, weather and other anomalous conditions disrupt air traffic flow resulting in significant costs.
INSERT INTO problem (pid, title, description, input, output, input_example, output_example, author, comments, point, "time", memory, fontsize, contest, date, abb, uid, enable, case_time_limit, multidata, disable_24h, special_judge, comments_es, comments_pt, description_pt, description_es, title_pt, title_es, input_es, input_pt, output_pt, output_es, event_created_processed, forum_link, id_source) VALUES (1009, 'Arranging Amplifiers', '<div style="text-align: justify;">Scientists at the TIFR, Mumbai, are doing some cutting edge research on the Propagation of Signals. A young researcher comes up with a method of progressively amplifying signals, as they progress along a path. The method involves the placing of Amplifiers at regular distances along the line. Each amplifier is loaded with a number a(i), which is called its amplification factor. The method of amplification is simple: an amplifier which receives a signal of strength X, and has Y loaded in it, results in a signal of strength Y^X [Y to the power X]. In course of his research, the young scientist tries to find out, that given a set of n amplifiers loaded with a(0), a(1), a(2), ..., a(n-1), which particular permutation of these amplifiers, when placed at successive nodes, with the initial node given a signal of strength 1, produces the strongest output signal.
INSERT INTO problem (pid, title, description, input, output, input_example, output_example, author, comments, point, "time", memory, fontsize, contest, date, abb, uid, enable, case_time_limit, multidata, disable_24h, special_judge, comments_es, comments_pt, description_pt, description_es, title_pt, title_es, input_es, input_pt, output_pt, output_es, event_created_processed, forum_link, id_source) VALUES (1012, 'Milk Measuring', '<div style="text-align: justify;">Farmer John must measure <span style="font-weight: bold;">Q (1 &lt;= Q &lt;= 20000)</span> quarts of his finest milk and deliver it in one big bottle to a customer. He fills that bottle with exactly the number of quarts that the customer orders.
INSERT INTO problem (pid, title, description, input, output, input_example, output_example, author, comments, point, "time", memory, fontsize, contest, date, abb, uid, enable, case_time_limit, multidata, disable_24h, special_judge, comments_es, comments_pt, description_pt, description_es, title_pt, title_es, input_es, input_pt, output_pt, output_es, event_created_processed, forum_link, id_source) VALUES (1002, 'New House', '<div style="text-align: justify;">Johan wants to build a new house and he wants his house as large as it can.<br>Given an <span style="font-weight: bold;">N x N</span> grid land, find the largest square size that fit in the free area.</div>', '<div style="text-align: justify;">The first line of input contains an integer <span style="font-weight: bold;">T (1 &lt;= T &lt;= 100</span>), the number of test cases follow.
INSERT INTO problem (pid, title, description, input, output, input_example, output_example, author, comments, point, "time", memory, fontsize, contest, date, abb, uid, enable, case_time_limit, multidata, disable_24h, special_judge, comments_es, comments_pt, description_pt, description_es, title_pt, title_es, input_es, input_pt, output_pt, output_es, event_created_processed, forum_link, id_source) VALUES (1004, 'Traversing Grid', '<div style="text-align: justify;">Starting at the top left corner of an <span style="font-weight: bold;">N x M</span> grid and facing towards the right, you keep walking one square at a time in the direction you are facing. If you reach the boundary of the grid or if the next square you are about to visit has already been visited, you turn right. You stop when all the squares in the grid have been visited. What direction will you be facing when you stop?
INSERT INTO problem (pid, title, description, input, output, input_example, output_example, author, comments, point, "time", memory, fontsize, contest, date, abb, uid, enable, case_time_limit, multidata, disable_24h, special_judge, comments_es, comments_pt, description_pt, description_es, title_pt, title_es, input_es, input_pt, output_pt, output_es, event_created_processed, forum_link, id_source) VALUES (1013, 'Perfect Pth Powers', '<div style="text-align: justify;">We say that <span style="font-weight: bold;">x</span> is a perfect square if, for some integer <span style="font-weight: bold;">b</span>, <span style="font-weight: bold;">x = b^2</span>. Similarly, <span style="font-weight: bold;">x</span> is a perfect cube if, for some integer <span style="font-weight: bold;">b</span>, <span style="font-weight: bold;">x = b^3</span>. More generally, <span style="font-weight: bold;">x</span> is a perfect pth power if, for some integer <span style="font-weight: bold;">b</span>, <span style="font-weight: bold;">x = b^p</span>. Given an integer <span style="font-weight: bold;">x</span> you are to determine the largest <span style="font-weight: bold;">p</span> such that <span style="font-weight: bold;">x</span> is a perfect pth power.</div>', '<div style="text-align: justify;">Each test case (no more than 50) is given by a line of input containing <span style="font-weight: bold;">x</span>. The value of <span style="font-weight: bold;">x</span> will have magnitude at least 2 and be within the range of a (32-bit) int in C, C++, and Java. A line containing 0 follows the last test case.</div>', '<div style="text-align: justify;">For each test case, output a line giving the largest integer <span style="font-weight: bold;">p</span> such that <span style="font-weight: bold;">x</span> is a perfect pth power.</div>', '17<br>1073741824<br>25<br>0<br>', '1<br>30<br>2<br>', '2004 Waterloo Local Contest [Gordon Cormack]', '', 5, 2000, 65536000, 30720, 1, '2011-10-13 08:13:25.0', '1013', 34227, true, 2000, false, false, false, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, true, 'https://coj-forum.uci.cu/viewtopic.php?f=22&t=1809', 505);
INSERT INTO problem (pid, title, description, input, output, input_example, output_example, author, comments, point, "time", memory, fontsize, contest, date, abb, uid, enable, case_time_limit, multidata, disable_24h, special_judge, comments_es, comments_pt, description_pt, description_es, title_pt, title_es, input_es, input_pt, output_pt, output_es, event_created_processed, forum_link, id_source) VALUES (1001, 'Pipes', '<div style="text-align: justify;">After writing a solver for the "movable maze" game, you have grown tired of it. After all, you already know the optimal solution. To entertain yourself, you find another puzzle game called "Pipes", and play that for a while. On one puzzle, you have not been able to find a solution by hand, and you think that there is no solution. You decide to write a program to tell you whether this is the case.
INSERT INTO problem (pid, title, description, input, output, input_example, output_example, author, comments, point, "time", memory, fontsize, contest, date, abb, uid, enable, case_time_limit, multidata, disable_24h, special_judge, comments_es, comments_pt, description_pt, description_es, title_pt, title_es, input_es, input_pt, output_pt, output_es, event_created_processed, forum_link, id_source) VALUES (1006, 'Ciphering Programs', '<div style="text-align: justify;">Enrique and Tom√°s are two good friends whose greatest entertainment is programming. As all good programmers, they challenge each other frequently, the challenges consisting mostly in solving online judge problems in as little time as possible.
INSERT INTO problem (pid, title, description, input, output, input_example, output_example, author, comments, point, "time", memory, fontsize, contest, date, abb, uid, enable, case_time_limit, multidata, disable_24h, special_judge, comments_es, comments_pt, description_pt, description_es, title_pt, title_es, input_es, input_pt, output_pt, output_es, event_created_processed, forum_link, id_source) VALUES (1000, 'A+B Problem', 'For this problem you must calculate <span style="font-weight: bold;">A + B</span>, numbers given in the input.', 'The only line of input contain two space separated integers <span style="font-weight: bold;">A, B (0 &lt;= A, B &lt;= 10)</span>.', 'The only line of output should contain one integer: the sum of <span style="font-weight: bold;">A</span> and <span style="font-weight: bold;">B</span>.', '1 2', '3', 'Typical problem (almost every online judge include it) []', 'Read our <span style="font-weight: bold;">FAQs</span> carefully to see solution samples. <br>', 5, 0, 0, 0, 0, '2011-10-13 19:59:47.0', '1000', 34227, true, 0, true, false, false, 'Lea nuestras <span style="font-weight: bold;">FAQs</span> cuidadosamente para ver ejemplos de c√≥digo fuente.  ', '<div style="direction: ltr; text-align: left;" id="OutputText" tabindex="99999" class="Wrap"><div><span class="" id="ouHighlight__0_3TO0_3">Leia</span><span id="noHighlight_0.7855851826503771"> </span><span class="" id="ouHighlight__5_7TO5_9">nosso</span><span id="noHighlight_0.6747936223946657"> </span><b><span id="ouHighlight__9_12TO11_13">FAQ</span></b><span id="noHighlight_0.08526182874241783"> </span><span class="" id="ouHighlight__14_22TO15_28">cuidadosamente</span><span id="noHighlight_0.5662067288548475"> </span><span id="ouHighlight__24_25TO30_33">para</span><span id="noHighlight_0.6894589797165609"> </span><span id="ouHighlight__27_29TO35_37">ver</span><span id="noHighlight_0.2979357640680471"> </span><span class="" id="ouHighlight__40_46TO39_46">amostras</span><span id="noHighl